import React, { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';

const NotificationPopup = () => {
  const [isVisible, setIsVisible] = useState(false);
  const [questionCount, setQuestionCount] = useState(0);
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    // Don't show if already on dashboard
    if (location.pathname === '/operator-dashboard') {
      setIsVisible(false);
      return;
    }

    // Check for unanswered questions every 5 minutes
    const checkQuestions = async () => {
      try {
        const response = await fetch('http://localhost:5235/api/questions/count');
        const data = await response.json();

        if (data.success && data.count > 0) {
          setQuestionCount(data.count);
          setIsVisible(true);
        }
      } catch (error) {
        console.error('Error checking questions:', error);
      }
    };

    // Initial check after 5 seconds (give user time to navigate)
    const initialTimeout = setTimeout(checkQuestions, 5000);

    // Then check every 5 minutes
    const interval = setInterval(checkQuestions, 5 * 60 * 1000);

    return () => {
      clearTimeout(initialTimeout);
      clearInterval(interval);
    };
  }, [location.pathname]);

  const handleGoToDashboard = () => {
    setIsVisible(false);
    navigate('/operator-dashboard');
  };

  const handleClose = () => {
    setIsVisible(false);
  };

  if (!isVisible) return null;

  return (
    <div
      style={{
        position: 'fixed',
        bottom: '30px',
        right: '30px',
        background: 'white',
        borderRadius: '16px',
        boxShadow: '0 8px 32px rgba(0, 0, 0, 0.2)',
        padding: '24px',
        maxWidth: '380px',
        zIndex: 9999,
        animation: 'slideUp 0.4s ease-out',
        border: '3px solid #f57c00'
      }}
    >
      {/* Close Button */}
      <button
        onClick={handleClose}
        style={{
          position: 'absolute',
          top: '12px',
          right: '12px',
          background: 'none',
          border: 'none',
          fontSize: '24px',
          color: '#999',
          cursor: 'pointer',
          padding: '0',
          width: '28px',
          height: '28px',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          borderRadius: '50%',
          transition: 'all 0.2s'
        }}
        onMouseEnter={(e) => {
          e.target.style.background = '#f5f5f5';
          e.target.style.color = '#333';
        }}
        onMouseLeave={(e) => {
          e.target.style.background = 'none';
          e.target.style.color = '#999';
        }}
      >
        √ó
      </button>

      {/* Icon and Badge */}
      <div style={{ display: 'flex', alignItems: 'center', gap: '16px', marginBottom: '16px' }}>
        <div style={{
          position: 'relative',
          width: '60px',
          height: '60px',
          background: 'linear-gradient(135deg, #ff9800 0%, #f57c00 100%)',
          borderRadius: '50%',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          fontSize: '32px'
        }}>
          üîî
          {questionCount > 0 && (
            <span style={{
              position: 'absolute',
              top: '-4px',
              right: '-4px',
              background: '#d32f2f',
              color: 'white',
              borderRadius: '12px',
              padding: '4px 8px',
              fontSize: '12px',
              fontWeight: '700',
              minWidth: '24px',
              textAlign: 'center',
              border: '2px solid white'
            }}>
              {questionCount > 9 ? '9+' : questionCount}
            </span>
          )}
        </div>

        <div style={{ flex: 1 }}>
          <h3 style={{
            margin: '0 0 4px 0',
            fontSize: '18px',
            fontWeight: '700',
            color: '#1a4d8f'
          }}>
            Neodgovoreni upiti
          </h3>
          <p style={{
            margin: '0',
            fontSize: '14px',
            color: '#666'
          }}>
            {questionCount} {questionCount === 1 ? 'pitanje ƒçeka' : 'pitanja ƒçekaju'}
          </p>
        </div>
      </div>

      {/* Message */}
      <p style={{
        margin: '0 0 16px 0',
        fontSize: '15px',
        lineHeight: '1.5',
        color: '#333'
      }}>
        Imate neodgovorene upite, odgovorite na njih ≈°to prije.
      </p>

      {/* Button */}
      <button
        onClick={handleGoToDashboard}
        style={{
          width: '100%',
          padding: '14px 24px',
          fontSize: '15px',
          fontWeight: '600',
          color: 'white',
          background: 'linear-gradient(135deg, #4a90e2 0%, #357abd 100%)',
          border: 'none',
          borderRadius: '10px',
          cursor: 'pointer',
          transition: 'all 0.3s',
          boxShadow: '0 4px 12px rgba(74, 144, 226, 0.3)'
        }}
        onMouseEnter={(e) => {
          e.target.style.transform = 'translateY(-2px)';
          e.target.style.boxShadow = '0 6px 16px rgba(74, 144, 226, 0.4)';
        }}
        onMouseLeave={(e) => {
          e.target.style.transform = 'translateY(0)';
          e.target.style.boxShadow = '0 4px 12px rgba(74, 144, 226, 0.3)';
        }}
      >
        Idi na kontrolnu tablu ‚Üí
      </button>

      {/* Animation styles */}
      <style>
        {`
          @keyframes slideUp {
            from {
              opacity: 0;
              transform: translateY(40px);
            }
            to {
              opacity: 1;
              transform: translateY(0);
            }
          }
        `}
      </style>
    </div>
  );
};

export default NotificationPopup;
